/**
 * All input variables need to be passed as a function parameter;
 * Objects received as parameters need to be parsed. Ex.: JSON.parse(inputVariable1);
 * Objects returned need to be stringified. Ex.: JSON.stringify(inputVariable1);
 */
function run(dados, response) {
    // Parse the input data if it's not already an array
    const parsedDados = typeof dados === 'string' ? JSON.parse(dados) : dados;

    // Extract the "full_name" values dynamically
    let dadosRequisicao = {};
    parsedDados.forEach((item, index) => {
        dadosRequisicao[`nome${index + 1}`] = item.full_name;
        dadosRequisicao[`disc${index + 1}`] = item.description;

    });

    // Return the resulting object
    return dadosRequisicao;
}

function run(avaliacao) {
    if(eUmNomero(avaliacao)) {
        avaliacao = parseInt(avaliacao);
        if(avaliacao < 0) return 0;
        if(avaliacao > 10) return 10;
        return avaliacao;
    }
    return "Outro";
}

// Valida se entrada é um número
function eUmNomero(num){
    return !isNaN(num)
}
